public class Atleta {

    private String nombre;
    private String codigoFederado;
    private int mejorMarca100m;
    private int mejorSalto;

    public String getNombre() {
        return nombre;
    }

    public void setNombre(String nombre) {
        this.nombre = nombre;
    }

    public String getCodigoFederado() {
        return codigoFederado;
    }

    public void setCodigoFederado(String codigoFederado) {
        this.codigoFederado = codigoFederado;
    }

    public int getMejorMarca100m() {
        return mejorMarca100m;
    }

    public void setMejorMarca100m(int mejorMarca100m) {
        this.mejorMarca100m = mejorMarca100m;
    }

    public int getMejorSalto() {
        return mejorSalto;
    }

    public void setMejorSalto(int mejorSalto) {
        this.mejorSalto = mejorSalto;
    }

}
